import PostCard from "./PostCard";

const samplePost = {
 nickname: '홍길동',
  title: '첫 게시글입니다!',
  createdAt: '2025-06-13T10:00:00Z',
  updatedAt: '2025-06-13T12:00:00Z',
  contentHtml: '<p>이건 정말 긴 게시글의 예시입니다. <strong>HTML 형식</strong>도 포함돼요.<br>줄바꿈도 됩니다.</p><p>이미지도 가능하고, 다양한 포맷이 적용될 수 있습니다. 여기에 아주 많은 텍스트가 있다고 가정합시다...</p>',
  thumbnailImage: 'https://via.placeholder.com/600x300',
};

export default function ArticleTest() {
  return (
    <div className="max-w-xl mx-auto mt-10">
      <PostCard post={samplePost} />
    </div>
  );
}
